import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React, { useState } from "react";
import Menu from "../components/Menu/Menu";
import OurModels from "../components/OurModels/OurModels";
import Man from "../pages/Man/Man";
import Woman from "../pages/Woman/Woman";
import Error from "../pages/Error/Error";
import Contact from "../pages/Contact/Contact";
import Newsletter from "../pages/Newsletter/Newsletter";
import NewsletterMain from "../pages/NewsletterMain/NewsletterMain";
import Person from "../pages/Person/Person";

function Root() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen((prev) => !prev);
  };

  return (
    <Router>
      <div className="App">
        <div className="wrapper">
          <Menu isOpen={isMenuOpen} toggleMenu={toggleMenu} />
          <Routes>
            <Route path="/" element={<OurModels />} exact />
            <Route path="/man" element={<Man />} />
            <Route path="/woman" element={<Woman />} />
            <Route path="/contact" element={<Contact />} />
            <Route path="/newsletter-sign" element={<Newsletter />} />
            <Route path="/newsletter" element={<NewsletterMain />} />

            {/* Динамический маршрут для моделей */}
            <Route path="/models/:category/:id" element={<Person />} />

            <Route path="*" element={<Error />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default Root;
